import React from 'react';
import { Carousel, Button } from 'react-bootstrap';
import '../styles/MainBanner.css';
import dog1 from '../images/dog1.jpg';
import dog2 from '../images/dog2.jpg';

const MainBanner = () => {
  return (
    <div className="main-banner-container">
      {/* Left Carousel */}
      <div className="carousel-container">
        <Carousel>
          {/* Carousel items for the left carousel */}
          <Carousel.Item>
            <img
              className="d-block w-100 carousel-image"
              src={dog1}
              alt="First slide"
            />
            {/* Carousel caption and other content */}
          </Carousel.Item>
          {/* ... other items */}
        </Carousel>
      </div>

      {/* Right Carousel */}
      <div className="carousel-container">
        <Carousel>
          {/* Carousel items for the right carousel */}
          <Carousel.Item>
            <img
              className="d-block w-100 carousel-image"
              src={dog2}
              alt="Second slide"
            />
            {/* Carousel caption and other content */}
          </Carousel.Item>
          {/* ... other items */}
        </Carousel>
      </div>


        {/* Right Carousel */}
      <div className="carousel-container">
        <Carousel>
          {/* Carousel items for the right carousel */}
          <Carousel.Item>
            <img
              className="d-block w-100 carousel-image"
              src={dog2}
              alt="Second slide"
            />
            {/* Carousel caption and other content */}
          </Carousel.Item>
          {/* ... other items */}
        </Carousel>
      </div>
    </div>
  );
};

export default MainBanner;
